import React from 'react'
import {FormControl, FormLabel, VStack } from "@chakra-ui/react";

const Signup = () => {
  return (
    <VStack spacing={4}>
     <FormControl>
        <FormLabel></FormLabel>
        <Input
          placeholder="Enter your name"
          onchange></Input>
     </FormControl>
    </VStack>
  );
}

export default Signup
